import React, { useState, useEffect } from 'react';
import axios from 'axios';

function AddData() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData(); // ดึงข้อมูลเมื่อ Component ถูกโหลดครั้งแรก
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('/api/data'); // เรียกใช้งาน API endpoint
      setData(response.data); // กำหนดข้อมูลที่ได้รับลงใน state
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div>
      {data.map(item => (
        <div key={item.id}>
          {/* แสดงข้อมูลที่ได้จาก MySQL */}
          <p>{item.field1}</p>
          <p>{item.field2}</p>
          {/* และอื่น ๆ ตามความต้องการ */}
        </div>
      ))}
    </div>
  );
}

export default AddData;
